//Hex display for HEX0-1
void display(int timer_value) {
	volatile int* hex_display = 0xFF200020; 
	int value = timer_value/10; //the tens value
	int tens_value = hex_display_number(value); 
	tens_value = tens_value << 8; 
	int remainder = timer_value - (value * 10); //ones value
	int ones_value = hex_display_number(remainder); 
	
	int total = tens_value + ones_value; 
		
	*hex_display = total; 
}

//hex display for HEX4-5
void display1(int timer_value) {
	volatile int* hex_display = 0xFF200030; 
	int value = timer_value/10; //the tens value
	int tens_value = hex_display_number(value); 
	tens_value = tens_value << 8; 
	int remainder = timer_value - (value * 10); //ones value
	int ones_value = hex_display_number(remainder); 
	
	int total = tens_value + ones_value; 
		
	*hex_display = total; 
}

//Delay loop for the A9 private timer for one second
void do_delay() {
	//update the load time
	volatile int* A9_Private_Timer = 0xFFFEC600; 
	int A9_load_time = 250000000; 
	*A9_Private_Timer = A9_load_time; 
	
	//update AE 
	volatile int* A9_Control = 0xFFFEC608; 
	*A9_Control = 3; 
	
	//wait loop 
	volatile int* A9_Interrupt = 0xFFFEC60C; 
	while(1) {
		if (*A9_Interrupt == 1) {
			break; 
		}
	}
}

//Hex display numbers 0 through 9
int hex_display_number(int timer_value) {
		if (timer_value == 0)
			return hex_value = 63; 
	
		else if (timer_value == 1) 
			return hex_value = 6; 
 
		else if (timer_value == 2) 
			return hex_value = 91; 
			
		else if (timer_value == 3) 
			return hex_value = 79; 

		else if (timer_value == 4) 
			return hex_value = 102; 

		else if (timer_value == 5) 
			return hex_value = 109; 
	
		else if (timer_value == 6) 
			return hex_value = 125; 
	
		else if (timer_value == 7) 
			return hex_value = 7;
	
		else if (timer_value == 8) 
			return hex_value = 127;
	
		else if (timer_value == 9) 
			return hex_value = 103; 
}

//FUNCTIONS FOR THE INTERRUPTS CONFIGURATION
void config_PS2(){
	volatile int * PS2_Control = (int *) 0xFF200104;
	*PS2_Control = 0x00000001;  //enable interrupts for PS2
}

void __attribute__ ((interrupt)) __cs3_isr_irq (void) {

	// Read the ICCIAR from the processor interface
 	int int_ID = *((int *) 0xFFFEC10C);
 	if (int_ID == 79) // check if interrupt is from the HPS timer
 		PS2_ISR();
	
 	else
  		while (1){} // if unexpected, then stay here
 
	// Write to the End of Interrupt Register (ICCEOIR)
	*((int *) 0xFFFEC110) = int_ID;
	return;
}

// Define the remaining exception handlers */
void __attribute__ ((interrupt)) __cs3_isr_undef (void) {
	while (1);
}

void __attribute__ ((interrupt)) __cs3_isr_swi (void) {
	while (1);
}

void __attribute__ ((interrupt)) __cs3_isr_pabort (void) {
	while (1);
}

void __attribute__ ((interrupt)) __cs3_isr_dabort (void) {
	while (1);
}

void __attribute__ ((interrupt)) __cs3_isr_fiq (void) {
	while (1);
}

void disable_A9_interrupts(void){
   int status = 0b11010011;
   asm("msr cpsr, %[ps]" : : [ps]"r"(status));
}

void enable_A9_interrupts(void){
	int status = 0b01010011;
	asm("msr cpsr, %[ps]" : : [ps]"r"(status));
}

void config_GIC(void) {
	config_interrupt (79, 1); 
	*((int *) 0xFFFEC104) = 0xFFFF;
	
	// Set CPU Interface Control Register (ICCICR). Enable signaling of interrupts
	*((int *) 0xFFFEC100) = 1;
 
	// Configure the Distributor Control Register (ICDDCR) to send pending interrupts to CPUs
	*((int *) 0xFFFED000) = 1; 
}

void config_interrupt (int N, int CPU_target) {
	int reg_offset, index, value, address;
	reg_offset = (N >> 3) & 0xFFFFFFFC;
	index = N & 0x1F;
	value = 0x1 << index;
	address = 0xFFFED100 + reg_offset;
 
	/* Now that we know the register address and value, set the appropriate bit */ *(int *)address |= value;
	*(int *)address |= value;
 
	/* Configure the Interrupt Processor Targets Register (ICDIPTRn) 
	* reg_offset = integer_div(N / 4) * 4
	* index = N mod 4 */
 
	reg_offset = (N & 0xFFFFFFFC);
	index = N & 0x3;
	address = 0xFFFED800 + reg_offset + index;
 
	/* Now that we know the register address and value, write to (only) the appropriate byte */ 
	*(char *)address = (char) CPU_target;
}

void set_A9_IRQ_stack(void){
	int stack, mode;
	stack = 0xFFFFFFFF - 7;// top of A9 on-chip memory, aligned to 8 bytes 
	mode = 0b11010010;
	asm("msr cpsr, %[ps]" : : [ps] "r" (mode));
	asm("mov sp, %[ps]" : : [ps] "r" (stack));
	mode = 0b11010011;
	asm("msr cpsr, %[ps]" : : [ps] "r" (mode));
}

//PS@ Interrupt Service Routine
void PS2_ISR(){
	volatile int * PS2_Control = (int *) 0xFF200104;
	*PS2_Control = 1;  // clear RI bit
 
	volatile int * PS2_ptr = (int *) 0xFF200100; // PS/2 port address
	int PS2_data, RVALID;
	char byte1, byte2, byte3 = 0;
 
	PS2_data = *(PS2_ptr); // read the Data register in the PS/2 port
	RVALID = PS2_data & 0x8000; // extract the RVALID field
 	if (RVALID) {
  		int key_pressed = PS2_data; 
  		byte1 = byte2;
  		byte2 = byte3;
  		byte3 = PS2_data & 0xFF;
  		int i; 
		
		//printf("current_position %d, i: %d  , \n", current_position); 
	   //If the user clicks a, to move the penguin to the left
		if (byte3 == 0x1C && i % 2 == 0 && current_position > 8) {
			current_position = current_position - 2; //Subtracting, to move to left
			cases(); 
			i = 0; 
			return;
		}
			
		else if (byte3 == 0xf0) {
			*(PS2_ptr) = 0xFF;
			cases(); 
			i++;
			return;
		}

		//If the user clicks d, to move the penguin to the right
		else if (byte3 == 0x23 && i % 2 == 0 && current_position < 118) {
			current_position = current_position + 2; //Adding, to move to right
			printf("pressed d, current:position %d\n", current_position); 
			cases(); 
			i = 0; 
			return;
		}
			
		
		//If the user clicks l, to unload bean bags from the truck
		else if (byte3 == 0x4B && i % 2 == 0 && (current_position >= 84 && current_position <= 118)) { 
			beans_collected += 1; //Takes as two because of interrupts
			printf("loaded and beans colected: %d\n", beans_collected);
			
			//If the penguin carries more than 4 beans, it breaks its back, so game is over
			if (beans_collected > 4 ) {
				GAME_OVER = TRUE; 
				LEVEL_SELECTED = FALSE;
				*(KEY_ptr) = 0b0000;
				*(LED_ptr) = 0b1111111111;
					
				bool SOUND_FOURTH = FALSE;
					
				//Simple for loop to display broken back screen for six seconds
				for(int i = 0; i < 6; i++)
				{
					draw_broken_back();
					wait_for_vsync(); // swap front and back buffers on VGA vertical sync
					pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
					draw_broken_back();
					wait_for_vsync(); // swap front and back buffers on VGA vertical sync
					pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
					
					//Check if the unmute switch has been turned on
					//Boolean to ensure sad audio is only played once, because the user lost
					if(*SW_ptr != 0b0000000001) {
						play = 1; 
						if (!SOUND_FOURTH) {
							printf("sound\n"); 
							audio(coin_2, 8000); 
							SOUND_FOURTH = TRUE; 
						}
					}
				}
				int zero = 0;
				display(zero);
			}
			PENGUIN_HOLDING_BEAN = TRUE;  
			L_PRESSED = FALSE;
			cases();
			return;
		}	
				
		//If the user clicks j, they can unload the beans onto the crate
		else if (byte3 == 0x3B && i%2 == 0 && (current_position < 20 && current_position >=8)) { 
			total_packages_dropped += beans_collected;  //Add two because of interrupts
			printf("Total beans collected is %d\n", total_packages_dropped);
			
			//Display the number of packages dropped off on the crate in HEX4-5
			//display1(total_packages_dropped);
			
			/*
			//If the user drops off ten packages, they win
			if (total_packages_dropped >= 10) {
				GAME_OVER = TRUE; 
				LEVEL_SELECTED = FALSE;
				*(KEY_ptr) = 0b0000;
				*(LED_ptr) = 0b1111111111;
					
				bool SOUND_FIFTH = FALSE;
				
				//A simple for loop to display the you win screen for six seconsd
				for(int i = 0; i < 6; i++)
				{
					draw_win();
					wait_for_vsync(); // swap front and back buffers on VGA vertical sync
					pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
					draw_win();
					wait_for_vsync(); // swap front and back buffers on VGA vertical sync
					pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
					
					//Checking if the mute switch has been turned on
					//Using a boolean to ensure happy noise is only played once because user won the game
					if(*SW_ptr != 0b0000000001) {
						play = 1; 
						if (!SOUND_FIFTH) {
							printf("sound\n"); 
							audio(coin_1, 8000); 
							SOUND_FIFTH = TRUE; 
						}
					}
				}
				int zero = 0;
				display(zero);
			}
			*/
			PENGUIN_HOLDING_BEAN = FALSE; 
			beans_dropped += 1; 
			beans_collected -= 1; //clears the value of collected beans, two due to interrupts
			if (beans_dropped == 1) {
				beans_height = 0; 
			}
				
			if(beans_dropped >= beans_collected) {
				beans_collected = 0; 
			}
			cases(); 
			return;
		}
 	}
	return;
}

//Function for all the possible cases that could occur in the game
void cases() {
	//Case 1 - Penguin with beans, but no crate 	
	if(PENGUIN_HOLDING_BEAN && beans_dropped <= 0) { 
		draw_penguin(); 
			
		//for beans on the penguin's head 
		int beans_counter = 0; 
		beans_height = 0; 
		while(beans_counter != beans_collected) {
			draw_beans(); 
			beans_height += 10; 
			//printf("case 1 - head: total: %d, counter %d\n", beans_collected, beans_counter); 
			beans_counter += 1;
		}
			
		//for beans in the crate 
		beans_counter = 0; 
		beans_height = 0;
			
		while(beans_counter != beans_dropped) {
			if (beans_collected == 1) {
				beans_height = 0; 
				clear_beans(); 
			}
				
			else if (beans_collected == 2) {
				beans_height = 20; 
				clear_beans(); 
			}
				
			else if (beans_collected == 3) { 
				beans_height = 25; 
				clear_beans();
			}
			draw_beans_on_crate(); 
			beans_height += 20; 
			beans_counter += 1; 
		}
	}
	
	//CASE 2
	else if (beans_dropped > 0 && !PENGUIN_HOLDING_BEAN) {
		draw_penguin(); 
			
		//for beans on the penguin's head 
		int beans_counter = 0; 
		beans_height = 0; 
		while(beans_counter != beans_collected) {
			draw_beans(); 
			beans_height += 10;
			//printf("case 3 - head: total: %d, counter %d\n", beans_collected, beans_counter); 
			beans_counter += 1;
		}
			
		if (beans_collected == 0) {
			clear_beans(); 
			beans_height += 20; 
			clear_beans(); 
			beans_height += 25; 
			clear_beans(); 
		}
			
		//for beans on the crate 
		beans_counter = 0; 
		beans_height = 0;
		while(beans_counter != beans_dropped) {
			draw_beans_on_crate(); 
			beans_height += 20; 
			beans_counter += 1; 
		}
	}
			
	//Case 3 - Penguin with beans and crate 
	else if (beans_dropped > 0 && PENGUIN_HOLDING_BEAN) { 
		draw_penguin(); 
			
		//for beans on the penguin's head 
		int beans_counter = 0; 
		beans_height = 0; 
			
		while(beans_counter != beans_collected) {
			draw_beans(); 
			beans_height += 10; 
			beans_counter += 1;
		}
			
		//for beans on the crate 
		beans_counter = 0; 
		beans_height = 0;			
		while(beans_counter != beans_dropped) {
		draw_beans_on_crate(); 
		beans_height += 20; 
		beans_counter += 1; 
			
		}
	}
			
	//Case 4 - Penguin without beans or crate  	
	else {  
		draw_penguin(); 
	}
}

void draw_pixel(int x, int y, short int line_color)
{
	*(short int*)(pixel_buffer_start + (y << 10) + (x << 1)) = line_color;
}

void wait_for_vsync() {
	volatile int* pixel_ctrl_ptr = (int*)0xFF203020;
	register int status;

	*pixel_ctrl_ptr = 1;

	status = *(pixel_ctrl_ptr + 3);

	while ((status & 0x01) != 0) {
		status = *(pixel_ctrl_ptr + 3);
	}
}

void clear_screen() {
	for (int x = 0; x < RESOLUTION_X; x++) {
		for (int y = 0; y < RESOLUTION_Y; y++) {
			draw_pixel(x, y, 0);
		}
	}
}

void swap(int* a, int* b) {
	int temp;
	temp = *a;
	*a = *b;
	*b = temp;
}

int abs(int a) {
	if (a < 0) {
		return -a;
	}
	return a;
}

//Function to output the audio
void audio (int beat[], int BUF_SIZE) {
	int counter = 0; 
	
	while (play) {
		counter++;
		printf("while %d\n", counter);
		fifospace =  *(audio_ptr + 1); // read the audio port fifospace register
			
		if ((fifospace & 0x00FF0000) > BUF_THRESHOLD) { // check WSRC
			while (buffer_index < BUF_SIZE) {
			int volume = beat[buffer_index] * 20000; 
				
				while((fifospace & 0x00FF0000) == 0){
					fifospace = *(audio_ptr + 1);
				}
				
				while((fifospace & 0xFF000000) == 0){
					fifospace = *(audio_ptr + 1);
				}
					
				*(audio_ptr + 2) = volume;
				*(audio_ptr + 3) = volume;
				++buffer_index;
				
				if (buffer_index == BUF_SIZE) { // done playback
					play = 0;
					buffer_index = 0;
					printf("Done playback\n"); 
					printf("Play %d\n", play); 
					break;
				}
				fifospace = *(audio_ptr + 1); // read the audio port fifospace register
			}
	  	}
	}	
}

